    const colors=useContext(colorContext)
    // console.log(colors)
  return (
    <div>
       <p style={{background:colors.color1}}>Hello</p>
       <Navbar />
      <h1>Hello</h1>
      <h1>{name}</h1>
      <h1>{number}</h1>
    </div>
  )
}
